import React, { useState } from 'react';
import axios from 'axios';

const ProviderProfile = ({ provider, onBack, onBook }) => {
  const [reviewData, setReviewData] = useState({ rating: 5, comment: '' });

  const handleReviewSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(
        `http://localhost:5000/api/providers/${provider._id}/reviews`,
        reviewData,
        { headers: { Authorization: `Bearer ${localStorage.getItem('token')}` } }
      );
      alert('Review submitted successfully');
      setReviewData({ rating: 5, comment: '' });
    } catch (err) {
      console.error('Submit review error:', err);
      alert(err.response?.data?.message || 'Failed to submit review');
    }
  };

  return (
    <div className="p-6 bg-white rounded-lg shadow-md">
      <button onClick={onBack} className="mb-4 text-blue-600 hover:underline">
        Back to Providers
      </button>
      <img
        src={provider.photo}
        alt={provider.name}
        className="w-32 h-32 object-cover rounded-full mx-auto"
      />
      <h2 className="text-2xl font-bold mt-4 text-center">{provider.name}</h2>
      <p className="text-gray-600 text-center">Service: {provider.service}</p>
      <p className="text-gray-600 text-center">Location: {provider.location}</p>
      <p className="text-gray-600 text-center">Rating: {provider.rating || 'No ratings yet'}</p>
      <div className="mt-4">
        <h3 className="text-xl font-semibold">Services Offered</h3>
        {provider.services && provider.services.length > 0 ? (
          <ul className="list-disc pl-5">
            {provider.services.map((service) => (
              <li key={service._id}>
                {service.name} - ₹{service.price} ({service.duration})
              </li>
            ))}
          </ul>
        ) : (
          <p>No services listed</p>
        )}
      </div>
      <div className="mt-4">
        <h3 className="text-xl font-semibold">Reviews</h3>
        {provider.reviews && provider.reviews.length > 0 ? (
          <ul className="space-y-2">
            {provider.reviews.map((review) => (
              <li key={review._id} className="p-2 bg-gray-100 rounded-lg">
                <p>Rating: {review.rating}/5</p>
                <p>{review.comment}</p>
              </li>
            ))}
          </ul>
        ) : (
          <p>No reviews yet</p>
        )}
      </div>
      <div className="mt-4">
        <h3 className="text-xl font-semibold">Add a Review</h3>
        <form onSubmit={handleReviewSubmit} className="space-y-4">
          <div>
            <label className="block mb-1">Rating (1-5)</label>
            <input
              type="number"
              min="1"
              max="5"
              value={reviewData.rating}
              onChange={(e) => setReviewData({ ...reviewData, rating: e.target.value })}
              className="p-2 border rounded-lg w-full"
            />
          </div>
          <div>
            <label className="block mb-1">Comment</label>
            <textarea
              value={reviewData.comment}
              onChange={(e) => setReviewData({ ...reviewData, comment: e.target.value })}
              className="p-2 border rounded-lg w-full"
            />
          </div>
          <button type="submit" className="bg-blue-600 text-white p-2 rounded-lg hover:bg-blue-700">
            Submit Review
          </button>
        </form>
      </div>
      <button
        onClick={onBook}
        className="mt-4 bg-green-600 text-white p-2 rounded-lg hover:bg-green-700"
      >
        Book Now
      </button>
    </div>
  );
};

export default ProviderProfile;
